import logo from './logo.svg';
import './App.css';
import SRP from '../src/Containers/SRP';

function App() {
  return (
    <div className="App">
      <SRP></SRP>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hello World
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <p className="text-danger">DANGER!!!!!!</p>
      </header>
    </div>
  );
}

export default App;
